import "./components/UI/W3.css";
import MenuRow from "./components/UI/MenuRow";
import MenuHalf from "./components/UI/MenuHalf";
import MenuPad from "./components/UI/MenuPad";

const expenses = [
  {
    id: "e1",
    title: "Toilet Paper",
    amount: 94.12,
    date: new Date(2019, 7, 14),
  },
  { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
  {
    id: "e3",
    title: "Car Insurance",
    amount: 294.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: "e4",
    title: "New Desk (Wooden)",
    amount: 450,
    date: new Date(2021, 5, 12),
  },
];

function addExpenseHandler(expense) {
  console.log("In App.js");
  console.log(expense);
}

const pads = [
  {
    header: "¡Evitemos rescates innecesarios!",
    description:
      "Nosotros te ayudamos, da click al botón de abajo para completar un formulario para guiarte en este proceso.",
    buttonText: "Ir al Formulario",
  },
  {
    header: "¡Juegos de la Plataforma Educativa!",
    description:
      "El Rescue Center cuenta con juegos para su plataforma educativa, ¡Disfruta de ellos!",
    buttonText: "¡Jugar!",
  },
];

function App() {
  return (
    <div>
      <MenuRow>
        <MenuHalf className={"w3-lime"} style={{ height: "600px" }}>
          <MenuPad padData={pads[0]}></MenuPad>
          <MenuRow className="w3-row">
            <div class="w3-half"></div>
            <div class="w3-half"></div>
          </MenuRow>
        </MenuHalf>
        <MenuHalf className={"w3-white"} style={{ height: "600px" }}>
          <MenuPad className="w3-center">
            <h1>Conocé nuestra Organización</h1>
            <div class="w3-center-align w3-padding-large">
              <button class="w3-button w3-black w3-round-xxlarge w3-hover-khaki">
                Visitar Página Web
              </button>
            </div>
          </MenuPad>
        </MenuHalf>
      </MenuRow>
      <MenuRow>
        <MenuHalf className={"w3-green"} style={{ height: "600px" }}>
          <MenuPad padData = {pads[1]}> 
          </MenuPad>
          <MenuRow className="w3-row">
            <div class="w3-half"></div>
            <div class="w3-half"></div>
          </MenuRow>
        </MenuHalf>
        <MenuHalf className={"w3-sand"} style={{ height: "600px" }}>
          <MenuPad className="w3-center">
            <h1>Conocé nuestra Organización</h1>
            <div class="w3-center-align w3-padding-large">
              <button class="w3-button w3-black w3-round-xxlarge w3-hover-khaki">
                Visitar Página Web
              </button>
            </div>
          </MenuPad>
        </MenuHalf>
      </MenuRow>
    </div>
  );
}

export default App;
